	sessionName = 'Token track'
	errorLog = open('errorlogs.txt', 'a+')
	print(exitMenu)
	print('\nThis item will allow you to find out the token of the account to which your IP was linked.')
	print(tokenTrackMenu)
	try:
		select = str(input('\nSelect: '))
		if select == '1':
			login = input('\nLogin: ')
			password = input('\nPassword: ')
			infoLogin = {
				'captcha_key': None,
				'gift_code_sku_id': None,
				'login': login,
				'login_source': None,
				'password': password,
				'undelete': False
				}
			req = requests.post('https://discord.com/api/v8/auth/login', json=infoLogin)
			if req.status_code in statuses:
				info = req.json()
				token = info['token']
				print(f'\nToken: {token}')
			else:
				errorLog.write(f"[{datetime.datetime.now().strftime('%Y-%m-%d %H:%M:%S')}] [{sessionName}] [Status_code: {req.status_code}] [Message: {req.json()}\n")
				print('\nError.')
		elif select == '2':
			file = open('tokens.txt', 'a')
			while True:
				login = input('\nLogin: ')
				password = input('\nPassword: ')
				infoLogin = {
					'captcha_key': None,
					'gift_code_sku_id': None,
					'login': login,
					'login_source': None,
					'password': password,
					'undelete': False
					}
				req = requests.post('https://discord.com/api/v8/auth/login', json=infoLogin)
				if req.status_code in statuses:
					info = req.json()
					token = info['token']
					print(f'Token: {token}')
					file.write(token + '\n')
				else:
					errorLog.write(f"[{datetime.datetime.now().strftime('%Y-%m-%d %H:%M:%S')}] [{sessionName}] [Status_code: {req.status_code}] [Message: {req.json()}\n")
					print('\nError.')
		elif select == '3':
			print(menu)
			select = str(input('\nSelect: '))
			if select == '1':
				print(helpTrackEN)
			elif select == '2':
				print(helpTrackRU)
			else:
				print('\nInvalid option.')
		else:
			print('\nInvalid option.')
	except KeyboardInterrupt:
		print('\nExit...')
	errorLog.close()
	nextCode = input('\nPress key to continue.')

